import React from "react";

export default function AppContent(){
    return(
        <>
        {/* Description  */}
        <div id="description" className="cards-1">
            <div className="container">
                <div className="row">
                    <div className="col-lg-12">
                        <div className="above-heading">DESCRIPTION</div>
                        <h2 className="h2-heading">Enter what you’re reading or your whole library. It’s an easy, library-quality catalog..</h2>
                    </div> {/* end of col */}
                </div> {/* end of row */}
                <div className="row">
                    <div className="col-lg-12">
                    <div className="card-group">
                        <div className="card">
                            <div className="card-image">
                                <img src="https://img.freepik.com/free-vector/people-reading-book-concept-with-people-scene-set-men-women-read-books-different-genres_198565-1951.jpg?w=2000" className="card-img-top" alt="alternative" />
                            </div>
                            <div className="card-body">
                                <h4 className="card-title">Great Community</h4>
                                <p className="card-text">Chances are your friends are discussing their favorite (and least favorite) books on Goodreads. .</p>
                            </div>
                        </div>
                        
                        <div className="card">
                            <div className="card-image">
                                <img src="https://img.freepik.com/free-vector/tiny-woman-sitting-huge-book-flat-vector-illustration_74855-5946.jpg?w=2000" className="card-img-top" alt="alternative" />
                            </div>
                            <div className="card-body">
                                <h4 className="card-title">Discover And Read More</h4>
                                <p className="card-text">This card has supporting text below as a natural lead-in to additional content.</p>
                            </div>
                        </div>
                        
                        <div className="card">
                            <div className="card-image">
                                <img src="https://i.pinimg.com/564x/c7/85/c8/c785c89fd3ae99a3a1731d7c83d24218.jpg" className="card-img-top" alt="alternative" />
                            </div>
                            <div className="card-body">
                                <h4 className="card-title">Choice Awards</h4>
                                <p className="card-text">This is a wider card with supporting text below as a natural lead-in to additional content. This card has even longer content than the first to show that equal height action.</p>
                            </div>
                        </div>
                    </div>

                </div> {/* end of col  */}
            </div> {/* end of row */}
        </div> {/* end of container */}
    </div> {/* end of cards-1 */}
    {/* end of description */}


    <div id="details" className="basic-1">
        <div className="container">
            <div className="row">
                <div className="col-lg-6">
                    <div className="text-container">
                        <h2>Now Is The Time To Upgrade Your Marketing Solution</h2>
                        <p>Target the right customers for your business with the help of Tivo's patented segmentation technology and deploy efficient marketing campaigns. Keep your customers happy and loyal.</p>
                        <ul className="list-unstyled li-space-lg">
                            <li className="media">
                                <i className="fas fa-square"></i>
                                <div className="media-body">Understand customers and meet their requirements</div>
                            </li>
                            <li className="media">
                                <i className="fas fa-square"></i>
                                <div className="media-body">Targeted client base with Tivo's efficient technology</div>
                            </li>
                        </ul>
                    </div>
                </div> 
